import React, { useEffect, useState } from 'react';
import TaskService from '../services/TaskService';

const FileStatusListingPage = () => {

  const [data, setData] = useState([]);

  useEffect(() => {
    TaskService.getFiles()
      .then((response) => {
       console.log(response.data);
        setData(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  console.log(data);


    const items = [
      { id: 1, name: 'Item 1', description: 'Description for Item 1' },
      { id: 2, name: 'Item 2', description: 'Description for Item 2' },
      { id: 3, name: 'Item 3', description: 'Description for Item 3' },
    ];

    console.log(items);

  
    return (
      <div className="container mx-auto p-4">
        <h1 className="text-3xl font-bold mb-4">File Listing Page</h1>
        <table className="min-w-full bg-white border border-gray-300 shadow-md rounded-md">
          <thead>
            <tr>
              <th className="py-2 px-4 border-b">Name</th>
              <th className="py-2 px-4 border-b">Current FLow</th>
              <th className="py-2 px-4 border-b">Type</th>
            </tr>
          </thead>
          <tbody>
            {data.map((item) => (
              <tr key={item.id}>
                <td className="py-2 px-4 border-b">{item.name}</td>
                <td className="py-2 px-4 border-b">{item.currentFlow}</td>
                <td className="py-2 px-4 border-b">{item.type}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

export default FileStatusListingPage;
